import React, { useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import { AppState, useAppDispatch, useAppSelector } from "./store";
import { initialise, real } from "./app.slice";
import { connect } from "http2";

const idSelector = (state: AppState) => state.imageID;

function App() {
  const dispatch = useAppDispatch();
  const id = useAppSelector(idSelector);

  useEffect(() => {
    dispatch(initialise());
  }, []);

  const onClickReal = () => {
    dispatch(real());
  };

  const onClickNotReal = () => {};

  const imageURL = `http://localhost:3000/api/v1/image?id=${id}`;

  return (
    <div className="App">
      <div className={"active-image"}>
        <img src={imageURL} />
      </div>
      <div>
        <button onClick={onClickReal}>Real</button>
        <button>Not real</button>
      </div>
      <div></div>
    </div>
  );
}

const mapStateToProps = (state: AppState) => {
  return {
    imageURL: `http://localhost:3000/api/v1/image?id=${state.imageID}`,
  };
};

export default connect(mapStateToProps)(App);
